import ExpenseItem from "./components/ExpenseItem";
function App() {
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem expenseDate="2022-06-14" expenseTitle="Car Insurance" expenseAmount="690"></ExpenseItem>
      <ExpenseItem expenseDate="2022-06-13" expenseTitle="Food and drink" expenseAmount="60"></ExpenseItem>
      <ExpenseItem expenseDate="2022-06-11" expenseTitle="rent" expenseAmount="900"></ExpenseItem>
    </div>
  );
}

export default App;
